import React from 'react'
import './Channels.css'

function Channels() {
    title = 'ss'
    return (
        <div className='channels'>
            <div className='channels_header'>
                <p className='channels_header_title'>{title}title</p>
            </div>
        </div>
    )
}

export default Channels
